import React from 'react';
import { Link } from 'react-router-dom';

const OrderTracking = () => {
    // Updated order status data with stages 3 and 4 removed
    const orderStatus = [
        { id: 1, status: 'Order Placed' },
        { id: 2, status: 'Preparing' }
    ];

    return (
        <div className="container py-5" style={{ backgroundColor: '#e0f7df', minHeight: '100vh',border:'' }}>
            <div className="card bg-transparent border-10">
                <div className="card-body">
                    <h1 className="text-center display-4 mb-4 text-black">Order Tracking</h1>
                    <ul className="list-group">
                        {orderStatus.map((status, index) => (
                            <li
                                key={status.id}
                                className="list-group-item d-flex justify-content-center align-items-center bg-light mb-3"
                            >
                                <span className="fw-bold">{status.status}</span>
                                {/* Display arrow-down icon between stages */}
                                {index < orderStatus.length - 1 && (
                                    <i className="bi bi-arrow-down mx-3 text-success "></i>
                                )}
                            </li>
                        ))}
                    </ul>
                    <div className="d-flex justify-content-center mt-4">
                        <Link to="/" className="btn btn-outline-light text-black">Back to Home</Link>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default OrderTracking;
